import Settings from "./components/templates/Settings";
import Template from "./components/templates/Template";
import {
  RecoilRoot,
  atom,
  selector,
  useRecoilState,
  useRecoilValue,
} from "recoil";
import { templateDetails } from "./store";
import { useState } from "react";
import { ServerFetch } from "./ServerFetch";
import { useEffect } from "react";
import axios from "axios";
import { configData } from "./constants";

const App = () => {
  const [data, setData] = useState(configData);

  return (
    <div className="flex">
      <div className="h-screen w-1/4 bg-gray-500">
        <Template onChange={setData} />
      </div>
      <div className="h-screen w-1/4 bg-blue-800">
        <Settings />
      </div>
      <div className="w-1/2 bg-green-200">
        {data.personal_details.text !== "" && (
          <div className="flex-col">
            <div>Personal Profile</div>
            <div>{data.personal_details.text}</div>
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
